import React from 'react'
import * as ROUTES from '../../constants/routes'
import { Link } from 'react-router-dom'
import styled from 'styled-components'

import postmates from '../../images/postmates.jpg'
import doordash from '../../images/doordash.jpg'
import grubhub from '../../images/grubhub.png'
import ubereats from '../../images/ubereats.jpeg'

import food from '../../images/food.jpg'

const StyledAppWindow = styled.div`
    display: flex;
    justify-content: space-around;
    align-items: center;
`

const AppWindow = ({ name }) => {
    let source 

    if (name === "postmates") {source = postmates}
    else if (name === "doordash") {source = doordash}
    else if (name === "grubhub") {source = grubhub}
    else if (name === "ubereats") {source = ubereats}

    return (
        <StyledAppWindow>
            <img src = {source} alt = {name}  />
            <p>{name}</p>
        </StyledAppWindow>
    )
}

export default AppWindow
